INSERT INTO `jokes` VALUES (1,'成功','她：“因为别人都不同情你，我才做你的妻子。”他：“你总算成功了。现在每个人都因此同情我。”','2013-10-28 20:10:37','2013-10-28 20:10:37'),(2,'结婚以后','女：“为什么从前你对我百依百顺，可结婚才三天，你就跟我吵了两天的架？”男：“因为我的忍耐是有限度的。”','2013-10-28 20:10:37','2013-10-28 20:10:37'),(3,'我们的','燕尔新婚，新娘对新郎说：“今后咱们不兴说‘我的’了，要说‘我们的’。”新郎去洗澡，良久不出，新娘问：“你在干什么哪？”“亲爱的，我在刮我们的胡子呢。”','2013-10-28 20:10:37','2013-10-28 20:10:37'),(4,'阎王之母','有一个男人，当他妻子临死时，他很悲伤地问她道：“妻呀！你死了之后，要使我当光棍了。现在趁你未绝气之前，先问你一句话：你死后，叫谁来做我的续弦夫人呢？你平日心中有否这个女人呢？”他妻子听了，虽在临终的时候，也挣扎起整个身体，怒气冲冲地骂道：“你这无情的男子，我尚未气绝，你就想续娶。像你这种忘恩负义的男子，谁个女人肯嫁你？你的后妻，一定是阎王的母亲无疑。”丈夫听了，摇摇头、说：“这样不可！一误不可再误。我已娶了阎王的女儿于先，难道还要娶阎王的母亲于后吗？”','2013-10-28 20:10:38','2013-10-28 20:10:38'),(5,'杞人忧天','妻子患了重病，医生宣告回天乏术。妻子即对丈夫说：“我现在希望你能够发誓。”“发什么誓。”“如果你再婚，不准把我的衣服给你的新妻子穿。”丈夫恍然大悟道：“这个我可以发誓。说实话，你根本不必操心，因为我再也不想找像你这样胖的太太了。”','2013-10-28 20:10:38','2013-10-28 20:10:38'),(6,'理由充分','法官：“离婚理由是什么？”新娘：“他打呼噜。”法官：“结婚多长时间了？”新娘：“三天。”法官：“离婚理由充分，结婚三天还不是打呼噜的时候。”','2013-10-28 20:10:38','2013-10-28 20:10:38'),(7,'报复','一位弥留之际的男人向妻子立下遗嘱：“我死后，但愿你能嫁给我们的邻居埃德先生。”\n妻子不解，于是他又解释说：“两年前，这混蛋卖给我的奶牛根本挤不出奶，我现在也要让他尝尝受骗的滋味。”','2013-10-28 20:10:39','2013-10-28 20:10:39'),(8,'聪明丈夫','某夫妇当街而过，一只鸽子飞过天空，一泡鸽粪不偏不倚正巧落在太太肩上，太太急了，忙叫丈夫拿纸。丈夫抬头，见鸽子不讲卫生，到处拉屎，却不知妻子叫他拿纸干嘛，说：“叫我有啥办法，追上前去给它擦屁股呀！ ”','2013-10-28 20:10:39','2013-10-28 20:10:39'),(9,'一枪双刁','有两个人去打高尔夫，休息中一位问另一位：“您是干什么的？”“我是为律师，您呢？”“实不相瞒，我是个杀手，不信你看我的包里还装着枪和望远镜。”这时律师拿起望远镜随便的看，突然看见自己家的凉台上，自己的妻子光着身子，有一位男人正在抚摩着他的妻子。他气急败坏的对杀手说：“赶快给我把这两个狗男女杀了。”杀手说：“行！我的一颗子弹是5000美金，两颗一共10000美金可以吗？”律师说：“没问题，快给我杀吧！ ”杀手又说：“看在我们很有缘得份上，我可以让你选择打他们的哪个部位？”律师说：“那个男人就打他的哪个地方吧！','2013-10-28 20:10:40','2013-10-28 20:10:40'),(10,'迷你','一天晚上妻子迫不及待的拥到丈夫怀里：“亲爱的，我想要………”丈夫手里拿着报纸，瞟都不瞟妻子一眼。于是，妻子恼羞成怒。\n第二天，丈夫又在看报纸，她穿着一身红色的性感泳装，在丈夫面前走来走去，丈夫还是不瞧她一眼。\n第三天，她又换上了一套蓝色的泳装，丈夫还是连头也不抬。\n到了第四天，妻子干脆什么也不穿，站在丈夫面前。这时，丈夫终于抬起了头，说：“前天，你穿了一身红色的泳装，真的很美，很性感，昨天你穿了一身蓝色泳装，也很美，怎么今天这身透明的泳装这么皱啊，该熨一下了………”','2013-10-28 20:10:40','2013-10-28 20:10:40'),(11,'你也属于我','夫妻吵架互不相让，最后丈夫勃然大怒说：“你快滚！把所有属于你的东西都带走！ ”妻子流着泪收拾好自己的行李，又把一只大麻袋往丈夫身边一扔说：“你钻进去！ ”丈夫吃了一惊，急问：“你要于什么？”“你也是属于我的，快钻进去！ ”妻子向丈夫吼道。','2013-10-28 20:10:40','2013-10-28 20:10:40'),(12,'死也不和你过','两口子关系不好，丈夫常常想着休妻另娶。老婆便威吓他说：“有朝一日你要是敢变了心，我非买点药毒死你不可。”男的说：“你下毒之前千万告诉我，我提前写好遗嘱，求官府别判你死罪。”妻子十分高兴：“到底是一日夫妻百日恩，难得你对我有那么点味儿。”男人说：“不是，我最怕官府杀了你，要是你死了，你的魂追到阴间，我不又得跟你过了吗？”','2013-10-28 20:10:41','2013-10-28 20:10:41'),(13,'事故与灾难','一位夫人问她的丈夫：“亲爱的，你能告诉我‘事故’与‘灾难’这两个词之间有什么区别吗？”“这很简单。”丈夫认真地回答说，“譬如你失足落水，这就叫‘事故’；如果人家又把你当鱼钓上来，这就是‘灾难’了。”','2013-10-28 20:10:41','2013-10-28 20:10:41'),(14,'吵架的结果','夫妻吵架了。当丈夫下班回到家里，他发现妻子不在家。只在桌上留了一个条子，上面写道：“午饭在《烹调大全》第215页；晚饭在317页。”','2013-10-28 20:10:41','2013-10-28 20:10:41'),(15,'绝招','大哥弄了一支甚重的自动步枪在家里，每逢大嫂发脾气，大哥总是二话不说，到旁边擦步枪去了。大嫂便吓得面容失色，一场内战还没开始，就结束了。我忍不住问大哥：“大嫂怕你杀她？”大哥很得意他说：“哪里，她是怕我自杀。”','2013-10-28 20:10:42','2013-10-28 20:10:42'),(16,'保险之险','太太不懂保险的道理，认为缴保险费是浪费，先生连忙解释说：“保险是为了你和孩子，万一我死了；你们也有个保障呀！ ”太太反驳说：“要是你不死呢？”','2013-10-28 20:10:42','2013-10-28 20:10:42'),(17,'补不足','妻：“我晓得，你与我结婚，是因为我有钱。”夫：“不是，是因为我没有钱。”','2013-10-28 20:10:42','2013-10-28 20:10:42'),(18,'未婚妻的定义','丈夫对妻子说：“杰克要是再问我们什么是‘未婚妻’时，我们该怎么解释呢？”“那就告诉他，”妻子说，“‘未婚妻’是指一个女人，在结婚后她所得到的一切，她还没有得到。”','2013-10-28 20:10:43','2013-10-28 20:10:43'),(19,'如此作品','妻子：“结婚半年多了，怎不见你搞文学创作？”丈夫：“我哪有那个天才呀！ ”妻子：“结婚前，你在‘征婚启事’上不是写了‘在省晚报上发表过作品吗？”丈夫：“我指的就是那份‘征婚启事’。”','2013-10-28 20:10:43','2013-10-28 20:10:43'),(20,'情有所钟','我祖父身高1. 60米，而健硕的祖母却高达1．80米。我小时候祖父已去世；有一次我跟祖母一起翻阅旧日的照片，突然想到他们两个站在一起一定很惹人注目。“祖母，”我问她，“你怎么会爱上一个比你矮的男人呢？”她转过脸来对我说：“孩子，我们是坐着谈恋爱的，等我站起身来，已经太晚了。”','2013-10-28 20:10:43','2013-10-28 20:10:43'),(21,'另有企图','夫妻二人吃饭时，妻说：“你现在怎么老是挑鱼身上的好肉吃？记得我们谈恋爱时，你最爱吃鱼头鱼尾……”“情况不同了嘛！ ”丈夫说，“现在我的目标是吃鱼，当时我的目标是钓鱼。”','2013-10-28 20:10:44','2013-10-28 20:10:44'),(22,'醉后','雄蟹向雌蟹求婚。雌蟹注意到雄蟹走路时是直行而非横行的。心里想：“这位先生真与众不同，我可不能让他跑掉。”于是他们当下就结婚了。第二天她注意到她的新婚丈夫和别的螃蟹一样，也在横行，就问道：“昨天你不是直行的吗？”“亲爱的，”她丈夫回答，“我可不能天天都喝得那么醉。”','2013-10-28 20:10:44','2013-10-28 20:10:44'),(23,'离婚','有一夭，两口子吵架，妻子闹着要同丈夫离婚。他们去法院的路上，要经过一条不大的河，到了河边，丈夫很快脱掉鞋子跳入水中。妻子站在岸边，瞧着冰冷的水，正愁着怎么过去。丈夫回过头来温和他说：“我背你过去吧！ ”丈夫背着妻子过了河。他们没走多远，妻子说：“算了，咱们回去吧！ ”丈夫诧异地问：“为什么？”妻子不好意思地低着头说：“离婚回来，准背我过河呢？”','2013-10-28 20:10:45','2013-10-28 20:10:45'),(24,'如实回答','妻子对丈夫表示不满地说：“啊，上帝呀！当初答应嫁给你的时候，我这脑袋瓜到哪里去了呢？”“在我的肩头上。”丈夫立即回答说。','2013-10-28 20:10:45','2013-10-28 20:10:45'),(25,'巧 合','要过圣诞节了。一对新婚夫妇完全不懂繁琐的节日仪式，于是丈夫叫妻子去愉看邻居铁匠家是怎么做的。妻走近窗口，看见铁匠正在用煤铲打老婆呢！妻子回家后，丈夫问她看见了什么，她死也不讲。最后丈夫气极了，拿起煤铲打她，她哭道：“既然你全知道，还让我去看什么？”','2013-10-28 20:10:46','2013-10-28 20:10:46'),(26,'不必当真','在一个盛大社交宴会上。主席收到一张字条：“假如格普塔先生在场的话，请马上回家。”一男士马上准备起身回家。“好了，不必了！ ”一位女士在大厅后面说道，“我只是想了解一下我丈夫是不是真的在这儿。”','2013-10-28 20:10:46','2013-10-28 20:10:46'),(27,'当天有效','“你是用什么办法把丈夫整夜不归的习惯改过来的？”“有一天晚上，他很晚才回来，于是我很快喊道：“‘是约翰吗？’而我丈夫的名字叫杰克。”','2013-10-28 20:10:46','2013-10-28 20:10:46'),(28,'对不起','丈夫又是一夜未归，妻子再也无法容忍了。一清早，丈夫推门进来，妻子用门后一根早已准备好的木棍将他打昏过去。待他一小时后醒来时，妻子抱歉他说：“亲爱的，对不起，我忘了你上夜班。”','2013-10-28 20:10:47','2013-10-28 20:10:47'),(29,'不必担心','一对夫妇坐夜车到外地访友。先生打算坐普通车，随便凑合度过一夜，可省下些费用。可太太却撒娇地说：“亲爱的，我希望能有一张卧铺，舒舒服服睡一夜。不然，在硬铺座我会睡不着的。”先生便应允着去买票了，但回来时却举着两张普通票，得意地对太太说：“仔细想了又想，还是普通车票便宜。”太太哭丧着脸说：“可我要失眠的呀！ ”“不要紧，我另外还买了两粒安眠药。”先生安慰她说。','2013-10-28 20:10:47','2013-10-28 20:10:47'),(30,'菩萨也会烦','新加坡某工程师的太太是虔诚的佛教徒，每天早晚须念千遍观音菩萨。丈夫对此很有看法，便打算想法改变太太的思想。某日，丈夫叫他太太，太太回了话，但他却毫不理会，又接着大叫了两句，如此一来，气坏了正在念经的太太，她气呼呼地说：“你穷叫什么？我又没聋！ ”丈夫回答：“我才叫你三句，你就生气；你每天叫观音菩萨千遍，不知你想过它的烦恼没有？”','2013-10-28 20:10:48','2013-10-28 20:10:48'),(31,'共同点','有人问一位妇女：“在你与丈夫20多年的共同生活中，你觉得你们存哪些共同点？”妇女考虑了很久以后答道：“我们唯一的共同点就是在同年同月同日结婚。”','2013-10-28 20:10:48','2013-10-28 20:10:48'),(32,'美容之后','妻子在美容院里接受了最新化妆术，嘴唇一片鲜红，眼睛用眼线、眼影、睫毛膏抹得非常鲜艳。她觉得自己变得很漂亮，急急忙忙地赶回家中，想让丈夫看了吃惊。她回到家里，愁眉苦脸的丈夫见了她那副模样立刻高兴起来：“咱们的儿子太淘气了，你去肯定会把他吓唬祝”','2013-10-28 20:10:49','2013-10-28 20:10:49'),(33,'夫妻小趣','妻子：“婚前你不是叫我天使吗？”丈夫：“对。”妻子：“为什么现在你不这佯叫我了呢？”丈夫：“呵，亲爱的，你应该高兴，现在我头脑正常多了。”妻子（在船上）：“如果这条船在沉下去，你首先救我还是救我们的孩子。”丈夫：“先救我自己。”妻子：“昨晚我做了一个美梦，梦见你答应给我200块钱买衣服。亲爱的，你会成全我的美梦吧？”丈夫：“那当然。说来巧，昨晚我梦见自己把200块钱给了你哩！ ”','2013-10-28 20:10:49','2013-10-28 20:10:49'),(34,'打招呼','妻子问丈夫：“当我快淹死的那阵，你看见那个前去救我的男人了吗？”“是的，他先到我这里打过招呼。”','2013-10-28 20:10:50','2013-10-28 20:10:50'),(35,'明智之举','有个妇人，按预约去看大夫，见了医疗报告单，弄得心都凉了，匆匆回到家。丈夫下班回家，一进屋，她就对他说：“亲爱的，大夫说我只能再活12个小时了。所以我决定，咱们应该上床，亲亲热热地过上一个通宵。你看怎么样？”“噢，这对你倒挺合适的。”丈夫回答说，“早上你就不必起床了！ ”','2013-10-28 20:10:50','2013-10-28 20:10:50'),(36,'自 白','产房里，即将临产的妻子对丈夫说：“我要告诉你，我的双眼皮是割的，鼻子是隆起来的，下巴是做的，所以娃娃生下来不像我的话，你不要吃惊。”丈夫安慰她说：“我早知道，不要紧。我也告诉你：我的右眼是假的，牙齿是装的，左腿是假肢！ ”','2013-10-28 20:10:51','2013-10-28 20:10:51'),(38,'本钱小了店面大了','女生不小心摸到男生的“那个”，於是就不好意思的问：“这是什么呀？”那男的回答：“本钱呀！ ”於是他们又接著继续温存。那男的不小心摸到女的“那个”，於是就不好意思的问：“这是什么呢？”那女的回答：“店面呀！ ”那男的就很高兴的说：“太好了！你有店面，我有本钱，我们一起来做生意吧！！ ”於是乎他们早也干晚也干，一天三餐，外加消夜及点心。最後那男的终於受不了而抗议说：“这太不公平了！我的本钱越做越小，而你的店面却越开越大！ ”','2013-10-28 20:10:51','2013-10-28 20:10:51'),(39,'空姐','从前有一只老鼠他很想找一个老婆，可是总是找不到。终于有一天他高兴的对他的朋友讲：“我有老婆了。呵呵！ ”朋友说：“你怎么不把弟妹领来让我们看看。”他说：“好吧明天。”于是第二天他带来了他夫人。大家看后（狂倒！！）怎么是只蝙蝠！“呵呵！这你们就不懂了。我老婆好赖也是个空姐呀！ ”再倒！！！！','2013-10-28 20:10:51','2013-10-28 20:10:51'),(40,'一毛钱的爱','“你有多爱我？”“一毛钱之多。”“只有这么一点么？”“一毛钱不就是‘十分’吗？”','2013-10-28 20:10:52','2013-10-28 20:10:52'),(41,'惊喜','一位太太突发奇想，想让丈夫有个意外惊喜。於是戴上假发，换上一套全新的衣服，并化了一个与平日不同的妆。然后到先生的办公室，卖弄风骚的说：“嗨！帅哥，你想不想和我………”他先生看了她一眼，立刻打断她的话，说：“不！我什么也不想，我一看到你就联想到我的老婆。”','2013-10-28 20:10:52','2013-10-28 20:10:52'),(42,'避孕','有一对夫妻，刚刚结婚不久，还不想要孩子，但不懂怎样避孕，就向医生求助。医生给了他们避孕套。夫妻高高兴兴回家了。过了几个月，妻子怀孕了。丈夫很生气就找到了医生大闹一顿。医生很纳闷，问：“你是怎么用的？”他说：“我一顿给我妻子吃两个呢！ ”','2013-10-28 20:10:53','2013-10-28 20:10:53'),(43,'妻子的埋怨','一对结婚四十年的老夫妻在谈话。妻子埋怨说：“你没有以前对我好了，以前你总是紧挨着我坐。”丈夫答：“这好办。”随即便移坐到她的身旁。“可过去你总是紧搂着我。”“这样好吗？”他搂住了妻子的脖子。“你还记得以前怎样吻我的脖颈，咬我的耳朵吗？”他忙跳起身，走出房门。妻子忙问：“你去哪儿？”丈夫答：“我得去取我的假牙。”','2013-10-28 20:10:53','2013-10-28 20:10:53'),(44,'太太画像','一位太太想画肖像，丈夫给她找来了最好的画家。当她坐下来画像时，提出了一个要求，希望给她画上项链、耳环、头饰等物，而事实上她并不戴这些金银首饰。画家同意了，但问道：“干吗要这样呢？”太太答道：“这是为了万一，你知道，我也许比我的丈夫死的早。那时他会马上再娶的，让他的新太太去找这些宝贝好了！ ”','2013-10-28 20:10:54','2013-10-28 20:10:54'),(45,'山东丈夫北京妻','一对小夫妻新婚之夜，女的对男的说：“我想要。”男的说：“俺给你。”过了一会儿，女的又说：“我还想要。”男的不悦：“俺再给你。”次日，女的说：“俺俺还想想要。”男的怒曰：“妈的，再要、再要都成了尿了。”','2013-10-28 20:10:54','2013-10-28 20:10:54'),(46,'做客','张先生和侯先生是好朋友。一日，张先生到侯先生家做客，侯先生不在。他的妻子对张先生说：“您贵姓。”“我姓张。”“是弓长张，还是立早章？”“弓长张。”“您用膳了吗？”“还没有。”“那我给您准备膳食。”张先生回家后对自己的妻子把侯先生的妻子大大夸赞了一番。张妻很是不服。某日，侯先生到张先生家拜访。张先生也不在，张妻问侯先生“您贵姓？”“免贵，姓候。”“您是公猴，还是母猴？”“公---猴。”侯先生一愣。“您骟了吗？”“还---没。”“那我进去给您骟了。”','2013-10-28 20:10:54','2013-10-28 20:10:54'),(47,'称赞过早','妻子：“我想给小狗起个名字叫‘拜伦’，母亲说这样侮辱了这位诗人；后来我想把你的名字改给它，母亲又说不好。”丈夫：“你的母亲真好。”妻子：“她说这样会侮辱了小狗。”','2013-10-28 20:10:55','2013-10-28 20:10:55'),(48,'打猎归来','打猎归来的丈夫在车站给家里打电话。“喂，是玛丽吗？你快来车站接我吧！ ”“收获怎么样？亲爱的。”“还可以，从现在起，至少一个月内我们不再买肉了。”“是打死了一只鹿？”“不，是工资全部花光了，现在我连坐车回家的车票钱都没有了……”','2013-10-28 20:10:55','2013-10-28 20:10:55'),(49,'离酒远点','妻：“你怎么用吸管喝酒呢？”夫：“是的！因为医生要我离酒远点儿。”','2013-10-28 20:10:55','2013-10-28 20:10:55'),(51,'当选','政治家在大选后对妻子说：“祝贺我吧，亲爱的，我当选了。”“你不是骗人吧？”“不，亲爱的，现在已经用不着骗人了！ ”','2013-10-28 20:10:56','2013-10-28 20:10:56'),(52,'合身的衣服','丈夫：“我给你买的那件衣服还合身吗？”妻子：“是的，而且我们的四个孩子穿也都很合身。”丈夫：“不错吧？我早就已经向你说过是件好衣服嘛！ ”妻子：“那倒不见得，每下一次水就缩一截，咱们只有四个孩子，现在都不敢再洗了。”','2013-10-28 20:10:56','2013-10-28 20:10:56'),(53,'虚 惊','妻子抱怨晚上太冷，买了一床电热毯，但丈夫伯不安全，经过半天时间解释，他才肯睡这床电热毯。在睡前，妻子在烤箱里放了一块火腿，用低温烤着，以便早上起来不必赶做早点。到午夜后，一阵肉香飘人卧室，丈夫从梦中惊醒，跳起来，摇醒妻子说：“亲爱的，快醒来，我们被烤熟了。”','2013-10-28 20:10:57','2013-10-28 20:10:57'),(54,'拳 击','夫妻俩常常发生争论，而每次争论的结果，总是妻子赢。每当争论到最激烈的时刻，丈夫就会退出争论而走到地下室去。在那里，保留着一个练习拳击用的吊袋。每次走到那里，他总要对准了吊袋猛击它15分钟，把怒气发泄出去，然后就觉得心情舒畅了。有一天，形势变了，争论的结果，丈夫赢了。这位丈夫感觉到他那位妻子快要大发脾气了，就建议去试一试他的那个吊袋。妻子接受了他的意见，来到地下室，一连十几分钟的猛击猛捶之后，她回到了楼上，乐得嘴都合不拢了。丈夫问她：“怎么这样高兴？”她回答说：“我为什么不应该高兴？我在第三轮就把你打得昏倒','2013-10-28 20:10:57','2013-10-28 20:10:57'),(55,'重温旧梦','加利米安老爹和老伴谈他们的青年时代，对遥远过去的回忆使他们激动不已，于是他们决定像年轻时做的那样，定了个到河边约会的日子。届时，老爹采集了鲜花，来到了河边等待，而老太大却觉得叫人看见太难为情。加利米安老爹空等一场，只有回家，他看到了老伴盖着羊皮袄躺在床上。老爹嚷起来了：“你怎么敢失约呢？”老太太把脸埋在枕头里，羞怯地说：“妈妈不让我去。”','2013-10-28 20:10:57','2013-10-28 20:10:57'),(56,'解释','凌晨，我和丈夫被一阵电话铃声吵醒，我嘟哝着去听电话。“谁呀？”紧接着一个男人悲哀急促的声音使我吃了一惊，“菲丽丝，我的心肝，别挂电话，请听我解释……”“但是……”我想插进去说。“我答应你我决不再那样干了，在这个世界上你对我就是一切！ ”“可是……”我急于解释。“不！听我说，没有你我会死的！ ”这时候，站在我身边的丈夫开始大笑起来。“你在外面有男人了。是吗？菲丽丝？”“我不是菲丽丝！ ”我大喊道，“你打错电话了！ ”“你为什么不早说？”那个男人叫道，“现在我又不得不再把这些话去重复一遍了！ ”停了一下，他平','2013-10-28 20:10:58','2013-10-28 20:10:58'),(57,'出乎意料','布莱尔上校回到家中，发现妻子安娜正和情人西蒙在卧室里谈笑。他大怒，指着西蒙骂道：“混蛋，你给我滚出去。”西蒙也不示弱：“滚出去的应该是你，安娜爱的是我。”布莱尔仍大骂不止，西蒙提出用决斗的方式决定谁拥有安娜。他们来到另一个房间，西蒙说：“咱们朝空中放空枪，然后两个人躺倒在地上装死，看安娜进来后先到谁身边，她先到谁身边就说明她爱谁，谁就拥有她。”两声枪响之后，安娜跑进来了，发现他俩都倒在地上，顿时欢呼着跑到大衣柜前喊道：“亲爱的，出来吧！他们两个都死了。”','2013-10-28 20:10:58','2013-10-28 20:10:58'),(58,'所谓圣人','一位老翁在客人面前介绍他三个儿子。他说：“大儿子是[上等人]，因为他怕老婆；二儿子是[中等人]，因为他敬老婆；三儿子是[下等人]，因为他打老婆。”客人忍不住问：“老翁是哪种人？”老翁说他是圣人，因为上中下全等来。','2013-10-28 20:10:59','2013-10-28 20:10:59'),(59,'贺年片','春节快到了，小王要给未婚妻挑一张贺年片。“这张比较适合，你看多漂亮！上面写道：向我唯一的心上人致以最美好的祝愿！ ”漂亮的女售货员给他出主意。“好极了！你给我十张……”','2013-10-28 20:10:59','2013-10-28 20:10:59'),(60,'借你的一用………','一书生新婚之夜只顾自己读书，不于新娘行房事。新娘耐不住寂寞，便上前挑斗书生。书生却一本正经的说：“你我父辈乃甚世之交（只不过是好友罢了），我决不会于你做出这等苟且之事！！！ ”新娘又好气又好笑，只好自己躺在床上自慰。朦胧之中见自己夫君的一只手伸了过来，大喜之时急忙闭上双眼等待好事的发生。但过了半天也不见动静，睁开眼睛却发现书生依旧在看书。新娘奇怪的问：“你刚才………”书生赶紧为自己解释：“我用口水翻书看了半天，早已口干舌燥；见你这里水源丰富，于是借你的一用………”','2013-10-28 20:10:59','2013-10-28 20:10:59'),(61,'思妻心切','丈夫：“亲爱的，你这次出差，我想你都快要疯了。”妻子：“瞧你，我不过才走了四天。”丈夫：“可是，整整四天我都没有找到放钱抽屉的钥匙。”','2013-10-28 20:11:00','2013-10-28 20:11:00'),(62,'好 客','“你太大知道我要去你家吃晚饭吗？”“当然知道了，为了这件事她跟我吵了几乎半个小时。”','2013-10-28 20:11:01','2013-10-28 20:11:01'),(63,'难得机会','“我妻子和别人私奔了！ ”“什么时候？”“前天在我洗澡的时候。”“啊，她一定等了很久，才得到这次机会。”','2013-10-28 20:11:02','2013-10-28 20:11:02'),(64,'正确无误','一个人问他非常害怕老婆的朋友说：“圣经上说：丈夫是妻子的头，你的情形是这样吗？”那朋友的妻子抢着答道：“怎么不是？我只是他的喉舌而已。我负责开口说话，他负责点头。”丈夫在旁点头表示赞同。','2013-10-28 20:11:02','2013-10-28 20:11:02'),(65,'信以为真','丈夫一连好几个星期夜不能寐。妻子看到几篇如何松弛神经的文章，就决定在他身上试试。待他上床以后，妻子柔声说道：“你想象你正坐在最爱去的那湖边垂钓。日光暖洋洋的，微风轻抚。鱼线上的浮子正上下颤动，在水里一路一招。”他的两眼合上了。妻子刚以为已获成功，谁知他一下子直挺挺在床上坐起来。他说：“可我钓鱼是从不用浮子的。”','2013-10-28 20:11:03','2013-10-28 20:11:03'),(66,'哎呀，你为什么会陪我到天荒地老呢！','丈夫见妻子满面愁容就关切的问道：“哦！亲爱的你怎么了？”“我很忧愁。”妻子回答道。“为什么呢？”丈夫愈加惊讶。妻子回答：“我不知道你会陪我一起到什么时候？”丈夫温柔的看着妻子说道：“你放心吧！我会陪你到天荒地老。”“这正是我担心的事情。”妻子叹气道。','2013-10-28 20:11:03','2013-10-28 20:11:03'),(67,'受二茬罪','老婆总觉得婚后的生活不够浪漫，有时就对老公说：“我们再谈一次恋爱如何？”谁知老公忙不迭的摆手，说：“算了吧，那玩意儿，太累！好歹骗了个老婆到手，今后就可以安安稳稳地过日子了，我决不愿再回到万恶的旧社会！ ”','2013-10-28 20:11:04','2013-10-28 20:11:04'),(68,'好女子','张三的儿媳妇整天在家里闹得不可开交。 张三没办法，找到媒人李四说：“当初你给咱娃介绍对象的时候，口口声声说是一个好女子，谁知她竟是这样……” 李四忙解释说：“当初我只说她是个好女子，可没说她是好媳妇呀！ ”','2013-10-28 20:11:04','2013-10-28 20:11:04'),(69,'还是步行好','阿拉尔罕买了１０头驴子。当他骑在驴上数数时，发现只有九头。而当他下来步行时，所数的驴子正好是１０头。骑上去数，又是９头。跳下来数，又是１０头。反反复复十来次，阿拉尔罕总结道：“还是步行好！ ”','2013-10-28 20:11:05','2013-10-28 20:11:05'),(70,'桥高','两个人相互吹嘘自己国家的桥高。一个人说：“在我们国家的那座桥上，一个人如果想跳河自杀，他得10分钟后才能落水淹死。”“这算什么。”另一个说，“在我们国家的那座桥上，如果一个人想跳下去自杀，你猜他是怎么死的……他是在下落的过程中饿死的！ ”','2013-10-28 20:11:05','2013-10-28 20:11:05'),(71,'因人而异','西德有一个人，对于违犯交通规则的罚款制度发生兴趣，故意把车子停在不应停车的地方，他一共收到三张传票。他衣冠楚楚的拿了第一张传票去见法官，法官罚了他三个马克。第二次他穿著乞丐似的衣服拿第二传票去见法官，法官罚了他两个马克。他又叫他美丽的妻子，拿了第三张传票去见法官，结果，法官只罚了他一个马克。','2013-10-28 20:11:06','2013-10-28 20:11:06'),(72,'生意兴隆','拳击比赛当中一位选手的牙齿都被打掉了。看的人心都提着。唯有一位观众高兴得眉开眼笑，手舞足蹈。作在旁边的观众好奇的问：“先生，你是拳击教练吗？”“不，我是牙科医生。”','2013-10-28 20:11:06','2013-10-28 20:11:06'),(73,'还没到家','哈比有些醉了，开始和弹钢琴的那位性感的女郎调情。这时，他的妻子走了过来，对他说：“回家后别忘了提醒我为你青肿的眼睛准备些药膏。”“可我的眼睛并没有青肿啊?”哈比不解地问。“我们这不是还没到家吗?”妻子冷笑着说。','2013-10-28 20:11:07','2013-10-28 20:11:07'),(74,'一条新裤','郑县某人，叫妻子为他做条新裤。妻子问:“裤子做成什么样式?”他说: “像那条旧裤一样。”妻子做成新裤后，就将它弄得像旧裤一样破旧。','2013-10-28 20:11:07','2013-10-28 20:11:07'),(75,'妥协','一位先生对别人说：我太太和我意见不和。她想要一件毛皮大衣，而我想要一部新车。最后我们互相妥协了，买一件毛皮大衣，然后把它收到车库里。','2013-10-28 20:11:07','2013-10-28 20:11:07'),(76,'心不在焉','结婚35周年的那一天，夫妻俩在餐桌上一起吃早餐，丈夫说：“老伴，你可知道，你我坐在这两把椅子上已经整整35年了吗？”老伴放下手中的报纸对他说：“你是不是想与我换个位子？”','2013-10-28 20:11:08','2013-10-28 20:11:08'),(77,'有一对夫妇要离婚','有一对夫妇要离婚，可是他们有一个孩子，两个人都想要，所以就告到法院去了。太太说：孩子是我生的，我生孩子的时候你都旁边凉快。所以孩子应该是我的。法官想想就说：嗯！！你对，孩子是你的。丈夫想想这样不对，结果他突然想道就说：不对不对！！请问法官大人！！你有没有看过自动贩卖机！法官说：怎样！丈夫说：你投钱进去掉出来的饮料是你的，所以孩子是我的。法官想想就说：嗯！你对！孩子是你的。','2013-10-28 20:11:08','2013-10-28 20:11:08'),(78,'时髦理由','“你知道为什么近来男人们都喜欢留着夫人一样的长发？”“因为，假如你的情人或妻子在他们衣服上发现了长发，他会笑着说：‘这是我的头发／”','2013-10-28 20:11:08','2013-10-28 20:11:08'),(79,'水出高原','安鸿渐很滑稽，但就是怕妻子。一年，丈人死了，按当地风俗，安鸿渐要身着素服哭于门口的路边。妻子把他喊到灵帐中责骂道：“你哭的时候为什么没眼泪？” 安鸿渐说：“你见到没泪时，是已经被手帕擦干了。”妻子严肃地说：“明日一早出棺，一定要哭出眼泪来！ ”安鸿渐只得诺诺应命。但哭不出眼泪实在是无法，就在出棺前，用一种较宽的手巾把湿纸头夹在中间，扎在额头上，每次叩头，总用力撞地以挤出水来，还装着嚎陶大哭的样子。刚哭罢，妻子又把他喊入灵帐内，一看大惊，说：“别人眼泪都从眼中流出，你怎么会从额上流出的啊？” 安鸿渐答道：“','2013-10-28 20:11:09','2013-10-28 20:11:09'),(80,'说个好字','老婆：“亲爱的，这肉丝好不好吃？” 老公：“马马乎乎。” 老婆：“这鱼呢？” 老公：“将就。” 老婆：“那这豆腐呢？” 老公：“一般。” 老婆按捺不住吼道：“你就不能说个好字？” 正喝着汤的老公大叫道：“好烫！ ”','2013-10-28 20:11:09','2013-10-28 20:11:09'),(81,'出色的演员','一辆有两名乘客的汽车闯红灯，被警察叫祝“我非常遗憾，”司机很快明白过来，说，“但是，我是个医生，急着把这个病人送进精神病医院。”警察怀疑司机是欺骗他，但是乘客也是一个相当聪明的小伙子，他用天使般的目光瞅着这位维护秩序者，微微一笑，小声说：“吻我一下吧，我亲爱的。”警察马上痛痛快快地放了他们。','2013-10-28 20:11:09','2013-10-28 20:11:09'),(82,'地下舞厅','某日，老苏往地下室第五厅接洽公务，适其太太拨来电话找他，当时接电话的同仁说：“ 苏厅长刚刚到地下五厅去了。”苏太太听后大为气愤地喊道：“上班时间怎么可以去地下舞厅？”','2013-10-28 20:11:10','2013-10-28 20:11:10'),(83,'坚强点，亲爱的','有一个囚犯逃离了关了他１５年的监狱。他越狱后，他闯入了一间民宅，看到了一对年轻的夫妻躺在床上。 他把那位丈夫的赶下床，绑在椅子上，把太太绑在床上，他上了床，亲吻那太太的脖子，然后就进去了洗手间。当那逃犯在洗手间的时候，丈夫跟他的太太说：“听著，这个男的是囚犯，看看他的衣服就知道！他可能被关很久，而且很久没碰过女人了，假如他想要做爱，千万不要抵抗，也不要抱怨，就让他做他想做的事，让他满足就好。这个人非常的危险，假如让他生气的话，他可能会把我们杀了。坚强点，亲爱的，我爱你！ ”这时候他太太说：“我很高兴你这样','2013-10-28 20:11:11','2013-10-28 20:11:11'),(84,'补心肝','妻子在厨房做饭，忙得满头大汗。丈夫却坐在餐桌边悠闲他说：“讲到吃，我最有研究。譬如吃猪脑补头脑，吃猪脚补脚筋，吃……”这时，妻子端来一盘炒猪心，放在餐桌上，丈夫夹一块放进嘴里，边吃边问妻子：“你知道这猪肝、猪心补的是什么？”“是补那些没心肝的人。”妻子不耐烦地答道。','2013-10-28 20:11:11','2013-10-28 20:11:11'),(85,'不能糟踏','一个农家妇女，丈夫接她到城里来祝 她孩子得病，吃了药，病治好了。药还剩下一些，她悄悄地把药吃光，很快自己病倒了。丈夫发现她吃了孩子剩下的药，埋怨她，她说：“不能糟踏东西呀！ ”','2013-10-28 20:11:12','2013-10-28 20:11:12'),(86,'等下一班车吧','一个女售票员和她丈夫一起乘凉。过了一会儿，两个一起往家里走，女的先进门，顺手就把门关上了，丈夫在外面大吼：“开门，我还在外面呢！！ ”她妻子在里面叫道：“吵什么吵，等下一班车吧！！ ”','2013-10-28 20:11:12','2013-10-28 20:11:12'),(87,'什么关系','某一律师问一已婚男人：你跟你的性生活美满吗？答曰：很美满啊！律师：那你为何要和你太太离婚？？男人：我的性生活跟我太太有什么关系啊？－。','2013-10-28 20:11:12','2013-10-28 20:11:12'),(88,'方式不同','我妻子一生气就乱摔乱砸，把气往东西上撒。”“我妻子可爱惜东西，她有气就往我脸上撒。”','2013-10-28 20:11:13','2013-10-28 20:11:13'),(89,'上下带口罩','闹非典期间，某妇人紧张得很，几乎无时无地不戴着厚厚的口罩，引起了丈夫的不满。后妇人来了月事，虽用了卫生巾仍经常渗漏。丈夫戏噱道：“好嘛，现在连下面也戴起了口罩。只是下面还要经常流‘口水’。”','2013-10-28 20:11:13','2013-10-28 20:11:13'),(90,'毒药汤','从前有位老公公，他很喜欢喝汤。他只要一天不喝就全身不舒服，所以他天天叫他太太煮给他喝。结果有一天他太太死了。他也没汤可以喝了啊！所以他开始叫他媳妇煮。 可是不论他媳妇煮的再好。他总是把它丢在一旁说：“不是这个味道。这么难喝的汤你也煮的出来啊！ ”刚开始媳妇总是忍气吞声，心想只要煮出那味道就好。但日子一天一天的过去了，她依然煮不出来，而且也越来越不耐烦，终於她起了杀机。 她要杀了她公公，可是她不知道要怎样下手。她想啊想的，突然她在角落发现了一罐已生锈不堪的杀虫剂，她把杀虫剂喷到汤里。然后鼓起勇气的拿给她公公','2013-10-28 20:11:13','2013-10-28 20:11:13'),(91,'睡不着','晚上丈夫在床上翻来复去睡不着，妻儿问：“亲爱的你这是怎么了？”丈夫说：“我借了老王家的钱明天就到期了。可是还没钱还这可该怎么办埃”妻儿听说：“啊你就为这个？”说着就下床走到窗边打开窗子就大声叫：“老王、老王，我家亲爱的明天没有钱还给你！ ”说完后就关好窗子回到床上，笑嘻嘻的说：“亲爱的你就安心的睡吧，现在该轮到老王睡不着了。”','2013-10-28 20:11:14','2013-10-28 20:11:14'),(92,'丈夫消费税','某管夫严协会在没收丈夫钱财，仍控制不住丈夫风流的前提下，制订如下章程：丈夫每晚出去会朋友前，必须向妻子交税（既向妻子交“公粮”）然后就可以出去了，反正已没有“公粮”交了，任你再神勇，没有子弹的枪是不能上阵地的。','2013-10-28 20:11:15','2013-10-28 20:11:15'),(93,'洗衣服','有一对夫妻，他们每次要做爱前，就用洗衣服来暗示。这一天，他们吵架了，老公想做，但又不想直接跟他老婆说，就叫他的儿子转告。他儿子跑到他妈前说：“妈，爸爸说他的衣服脏了，想拿来洗。”妈对儿子说：“今天洗衣机坏了，不能用了。”但过了一段时间，她也想做，就叫他儿子转告，叫他爸爸把衣服拿来洗，儿子跑去对爸爸说完了后，爸爸就说：“你去跟你妈说，我已经用手洗过了。”','2013-10-28 20:11:15','2013-10-28 20:11:15'),(94,'各有所思','妻子：“你这个人太不近人情了，每次看见漂亮的女子，就忘了自己已经结过婚了。”丈夫：“恰恰相反！我每次看见漂亮的女人，心里最耿耿于怀的就是自己已经结了婚。”','2013-10-28 20:11:15','2013-10-28 20:11:15'),(95,'姐妹夸夫','三个姐妹在一起谈论起了各自的丈夫。老大说：“我的丈夫每次能干我两个小时。”老二说：“我的那位每次能干我四个小时呢。”老三脸红红的一直未支声，老大和老二问老三，老三羞答答的说：“八分钟。”老大和老二奇怪的问：“怎么这么短时间？”老三道：“光射精八分钟。”','2013-10-28 20:11:16','2013-10-28 20:11:16'),(96,'都没变','丈夫：“今天是我们的结婚纪念日，当时的一切就好像在眼前，你还和当年一样，一点没变。”妻子：“当然，10年来我就一直穿着这件衣服呀！ ” ','2013-10-28 20:11:16','2013-10-28 20:11:16'),(97,'上荧屏','电视台反复播映着“寻人启事”：“和子，你在哪里？看到电视后，赶快回家，你丈夫在焦急地等着你。”在播映过失踪者的照片后，电视播音员又继续说：“和子的丈夫，你一定很难过了，但你思考过没有，妻子为什么突然要离开你呢？……”正在看电视的丈夫默默地回答：“我怎么会知道呢？我的妻子总是想让她的照片通过电视到处传播，哪怕只是一刹那也好……我们只好想出这个办法。现在她如愿以偿了，她马上就会回到家里来！ ”','2013-10-28 20:11:17','2013-10-28 20:11:17'),(98,'微不足道','丈夫躺在床上，他得了感冒。“亲爱的，如果我死了，你会因想念我而感到有点忧郁吗？”“那当然，亲爱的，因为你是知道的：任何微不足道的小事我都要哭一场的。”','2013-10-28 20:11:17','2013-10-28 20:11:17'),(99,'找丈夫','一女人找到私家侦探社，要求帮助寻找丈夫。私家侦探问：“您丈夫的照片有吗？”女人说没有。“那么，您丈夫长什么模样？他有什么嗜好？个人能力如何……等等，我们需要线索。”女人道：“他长得很高，体形不肥不瘦，很有钱，业余爱好音乐，对我很体贴，性功能正常……”“我认识你丈夫，”一位刚刚进来的太太插嘴说，“他完全不是这个样子！ ”“别理她，”女人忙对侦探说，“要是你们帮我找到我所要求的丈夫，家里那个我就不要了！ ”','2013-10-28 20:11:17','2013-10-28 20:11:17'),(100,'想要……','在法庭上，律师问：“夫人，离婚后您打算得到些什么？”“我想要孩子、房子、汽车和……一个真心爱我的丈夫。”','2013-10-28 20:11:17','2013-10-28 20:11:17'),(101,'太晚了','妻子在临终的丈夫旁哭泣，丈夫安慰道：“别伤心了！也许不久你会再找到一位理想的伴侣！ ”妻子反而哭得更伤心他说：“谁会要我这老太婆呢？如果你10年前就这样的话……” ','2013-10-28 20:11:18','2013-10-28 20:11:18'),(102,'太太还没批准','艾登斯对轰轰烈烈的女权主义运动颇不以为然。有位朋友建议他写一本提倡男权主义的书，艾登斯说：“早就写好了。”“那为什么还不出版呢？”“太太还没批准呢。”艾登斯苦笑着说。','2013-10-28 20:29:46','2013-10-28 20:29:46'),(103,'两 倍','一个妇女沿着海边垂头丧气地走着，忽见沙中有个瓶子。拾起瓶子拔开瓶塞，唰地冒出了一大股浓烟。一个魔怪在浓烟中对她说：“你把我从牢狱中放出来了，为了报答你，准你实现三个心愿。不过你得当心，对于你许下的每一个心愿，你男人都会得到相当于你所得到的两倍。”“为什么呢？”女人问道，”那个无赖抛弃了我，投入了另一个女人的怀抱埃”“上帝就是这么安排的。”魔怪答道。妇女耸了耸肩，于是向魔怪提出要100万美元。电光一闪，在她的脚边出现了100万美元；而同一时刻，在另外一个地方，也就是在抛弃了她的丈夫的脚边突然出现了200万美','2013-10-28 20:29:46','2013-10-28 20:29:46'),(104,'想不到的帮凶','百万富翁的夫人突然接到一封恐吓信，说三天之内不送5万美元到指定地点，将暗杀她的丈夫。夫人迅速将一个信封送到那个地方，强盗打开信一看，没有钱，只有一张便条：“希望你们信守诺言，我以后会给你10万美元报酬。”','2013-10-28 20:29:46','2013-10-28 20:29:46'),(105,'谁是第二个丈夫','太太回家以后，高兴地对丈夫说：“我今天请人看过手相，他说我的第二个丈夫是个英竣学问又好、非常体贴人的人。”“哦？”丈夫连忙问道，“你跟我是第二次结婚吗？”','2013-10-28 20:29:47','2013-10-28 20:29:47'),(106,'不再惦记','达芙妮的丈夫年纪轻轻地就死了。葬礼之后，她的朋友们来看望她。“你真可怜，达芙妮，你每天晚上等待的人儿再也不会回来了 。” “噢，我已经习惯了。不过，我现在至少已经知道他是在哪里过夜了，再也不用老是惦记了。”','2013-10-28 20:29:47','2013-10-28 20:29:47'),(107,'另请高明','莉莎：“爸爸，这道算术题我不会算。你能告诉我吗？”爸爸：“你说说，是什么题？”莉莎：“有个人每月薪水300元，他太太每月却要花去320元，问……”爸爸：“别问我了，还是问你妈去吧，她是这方面的专家。”','2013-10-28 20:29:47','2013-10-28 20:29:47'),(108,'发 现','一位官员接连几个晚上参加会议，使他的妻子产生了怀疑和怨恨。一天早上，他回到家里，发现一张便条，上面写道：“前天你是在昨天早上回家的；昨天你是在今天早上回家的；因此，如果你今天是在明天早上回家的话，那你就会发现我已在昨天离开你了。”','2013-10-28 20:29:48','2013-10-28 20:29:48'),(109,'绝 望','看护妇甲：“505号病人，彻底绝望了。”看护妇乙：“呀，为什么？刚才他还握着我的手，谈了好久呢。”看扩妇甲：“正是这样，刚才被他夫人看见了。”','2013-10-28 20:29:48','2013-10-28 20:29:48'),(110,'一家之主','我们教堂按照殖民时期英国的风俗做了一次主日礼拜。牧师穿着长袍和灯笼裤，教徒则按性别分开：男人在左边，女人在右边。到捐款时，牧师宣布这也要按过去的方式办，他要求“一家之主”上前来把钱放在供坛上。男人们立刻站了起来，有趣的是许多人跨过走道去向他们的妻子要钱。','2013-10-28 20:29:48','2013-10-28 20:29:48'),(111,'像在家里一样','丈夫忍受不了凶悍泼辣妻子的折磨，逃出家门，投宿旅馆。旅馆经理为他打开一个房间，讨好说：“住在这里，你会感到像在自己家里一样。”这人一听此言，大声呼救：“天那，快给我换个房间吧！ ”','2013-10-28 20:29:49','2013-10-28 20:29:49'),(112,'流言蜚语','某先生是地方上的要人。一天，他像往常一样在书房里例览当日报纸，突然对妻子大声喊道：“喂，安娜，你看到今天早报上的流言蜚语了吗，真可笑！他们说，你收拾行装出走了。你听见了吗、安娜、你在哪儿？安娜？啊！ ”','2013-10-28 20:29:49','2013-10-28 20:29:49'),(113,'偷情','一对夫妻在床上熟睡。大约是半夜时分。好像外面有什么动静，把妻子惊醒了。妻子有点迷迷糊糊，连忙把身边的丈夫推醒。并对丈夫说道：“ 快点起身，好像我丈夫回来了。”丈夫被妻子给推醒了，也是迷迷糊糊的，听到妻子的话后，边起身边说：“你怎么不早说，那我现在该往哪儿躲埃”','2013-10-28 20:29:49','2013-10-28 20:29:49'),(114,'夫妻之间','当我照例在下午5点下班回家时，发现妻子那天情绪不佳，其结果便是短兵相接和令人不快的态度，我的所作所为没有一样是对的。 到了晚上7点，事态还不见好转，于是我提议我走出去，假装刚到家，然后一切从新开始，妻子答应了。 我出门后，再一次进来说道：“亲爱的，我回来了！ ” “你刚才上哪儿去了？”她厉声问道，“已经7点了。”','2013-10-28 20:29:50','2013-10-28 20:29:50'),(115,'不会冲突','一位女士和一位足球教练结婚快40年了， 她深知球赛对丈夫来说总是头等重要的事。 有一天她特别沮丧，脱口而说： “弗郎克，你呀，宁可误了我的葬礼，也要去看球赛！ ” 丈夫非常心平气和，答道： “罗伯塔，到底是什么使你想到， 我会把你的葬礼安排在有球赛的日子呢？”','2013-10-28 20:29:50','2013-10-28 20:29:50'),(116,'妙 招','莫特·沙尔非常同情“足球寡妇”。有一次，一位妇女问他怎么才能将她丈夫的注意力从电视上转到她身上，他回答：“穿透明的衣服。” “要是这样也不奏效呢？”她问。 “那你在背上贴个号码！ ”沙尔回答。 ','2013-10-28 20:29:50','2013-10-28 20:29:50'),(117,'恩爱的夫妻','一对恩爱甚笃的夫妇正庆祝他们的金婚日。 看热闹的中年邻居问老生先说：「为什么你们可以维持五十年幸福美好的婚姻，打从我出生起，就未曾听过你们吵架的声音，难道你们之间从来没有任何的争执吗？」老先生说：「争执当然是有的，不过都不会扩大。我从蜜月旅行的时候就懂这个道理了...记得当时交通不便我们到大峡谷去度蜜月，一个人各雇了一匹驴子。她的驴子显然好吃懒做，走没有多久就赖在路边休息。我只听到我太太冷冷地说：『第一次。』驴子第二次想偷懒的时候，她又指着驴子说：『这是第二次。』当驴子第三次不肯走时候，她不慌不忙的掏出她','2013-10-28 20:29:51','2013-10-28 20:29:51'),(118,'饺子结婚','2个饺子结婚，当晚闹洞房。送走客人后，公饺子回屋猛然发现床上有个肉丸?子，而母?饺子却不见了。慌得他连忙叫到：“我的新娘子哪里去了？” 肉丸子嗔怪地说：“讨厌，人家脱了衣服你就不认识人家了？！ ”','2013-10-28 20:29:51','2013-10-28 20:29:51'),(119,'准时回家','一个典型的大男人娶了个典型的小美女，婚礼刚刚结束，大男人就立下了下面的规矩： “我想什么时候回家就什么时候回家，只要我想，不论是什么时候我想，你都不能为此为难我！ “每天晚上你必须为我准备好一顿丰盛的晚餐，除非我告诉你我不回来了。只要我想，我就可以和我的老朋友出去打猎、钓鱼、饮酒或打牌，你也不能为此刁难我！这就是我的规矩……你有什么意见吗？” 他的新娘很大度地说：“没有意见，你为我想得很周到。我只是提醒你记住一件事情……每天晚上七点准时做爱——不论你在还是不在！ ”','2013-10-28 20:29:51','2013-10-28 20:29:51'),(120,'化装舞会','化装舞会前，太太忽不适，便叫丈夫单身赴会。稍后，太太自觉好了点，便换上一套丈夫从未见过的时装，驱车也去参加舞会了。刚进门，太太便看见丈夫与其他女人打情骂俏，不禁妒火中烧，决定试探一下丈夫。她走到丈夫身旁，娇声媚气，投怀送抱。最后还引诱他到后花园去，尽情风流。到了午夜，当大家将要脱下面具时，太太才悄悄离去。而她丈夫直到凌晨三时才回来。 “舞会怎么样？”太太问。 “一点也不好玩。”丈夫答。 “你在那里究竟干了些什么？”太太再三追问。 “老实告诉你吧，”丈夫道，“我到那里时，见到几个朋友都没有带妻子，于是我们几','2013-10-28 20:29:52','2013-10-28 20:29:52'),(121,'停电','一对新婚夫妇去一个小岛度蜜月。在入住的时候老板对他们说:“这个岛电力有问题，估计一小时要停一次电！ ”于是这小夫妻决定每停一次电就做一次爱。3小时后，丈夫偷偷跑下楼来对老板说：“老板我多给你50元，你能不能2小时停一次电？”老板回答：“怎么不早说 你妻子多付了100元要我半小时停一次电！ ”','2013-10-28 20:29:52','2013-10-28 20:29:52'),(122,'巧答恋爱经过','婚礼晚会上，许多朋友让新郎介绍恋爱经过，新郎说：“本新郎姓张，新娘姓顾。我俩尚未认识对方时，我东‘张’西望，她‘顾’影自怜。后来我‘张’口结舌去找她，她左‘顾’右盼等着我。到认识久一点，我便明目‘张’胆，她也无所‘顾’忌。于是，我便请示她择日开‘张’，她也欣然惠‘顾’”。','2013-10-28 20:29:53','2013-10-28 20:29:53'),(123,'担心','妻子对丈夫说：「你每次出门，我都会非常担心。」「亲爱的，别担心，」丈夫安慰她道，「我会随时回来的。」「这正是我所担心的。」','2013-10-28 20:29:53','2013-10-28 20:29:53'),(124,'去世之后','丈夫：玛丽，我去世之后，把商店交给查理。 妻子：为什么不给杰克？杰克比查理聪明。 丈夫：好吧，那就把房子给查理。 妻子：查理不是自己有房子吗？我说应该给戴维。 丈夫：好吧，那就把马车给查理。 妻子：可是苏珊住在乡下，她更需要马车。 丈夫：给我住嘴！是我要死还是你要死？','2013-10-28 20:29:53','2013-10-28 20:29:53'),(125,'电话声响起','电话声响起。。。 女：喂！ 男：喂，你猜一下我是谁？ 女：GSBE！ 男：不是！ 女：JACK！ 男：不是！ 女：LEON！ 男：NO！ 女：哦，是KEN！ 男：NO！！NO！！ 女人心想：我的情人都数了啊？ 女：那你是谁啊？ 男大声的说：他们都是谁？！？你连老公都忘了！？？','2013-10-28 20:29:54','2013-10-28 20:29:54'),(126,'魔鬼的妹妹','有一位妇人她老公常常买醉后才回家，于是，她决定要改正他这项恶习。在万圣节当晚，她穿着一件魔鬼戏服，躲在一棵树的后面，准备在她老公回家的路上等他。当他老公走近时，她手持乾草叉，头戴红帽，屁股留著一条长尾巴地跳到他的面前。老公问：“你是谁？”妇人答：“我是魔鬼！ ”她老公接著说：“走！和我一起回去，我已经娶了你妹妹了！ ”','2013-10-28 20:29:54','2013-10-28 20:29:54'),(127,'捏着刹车','夫妻二人骑双人自行车外出郊游。两人吃力而艰难地爬上一个大坡后，丈夫一边喘气一边说道：“这，这个坡，可真，真难爬，累死我了！ ”“可不是，坡度太陡了！要不是我一直捏着刹车，恐怕我们早就滑下去了！ ”妻子擦了把汗说道。','2013-10-28 20:29:54','2013-10-28 20:29:54'),(128,'风流的妻子','丈夫经常听到有关妻子的风言风语，决定调查一下。于是他对妻子谎称出差，假装地收拾行李后，离开了家。到了深夜，他径直奔家而去。奇怪，家门口站了一排男人，为了不打草惊蛇他决定翻墙而入，可是当他刚刚爬上墙就被一个男人揪了下来。那个男人骂道：“你还想加塞儿？站排去！ ”','2013-10-28 20:29:55','2013-10-28 20:29:55'),(129,'粗心的丈夫','格尔·普什卡牵着狗从兽医那里回到了家。他叹着气对妻子说：“我们这条可怜的狗，它一路上一直在叫，仿佛有什么话要对我说！ ”妻子打量了一下那只狗，喊了起来：“蠢货！这只狗大概是想告诉你，它根本就不认识你。”','2013-10-28 20:29:55','2013-10-28 20:29:55'),(130,'受伤的原因','一次叔叔从外面回来时手上包着药布，婶婶见了关心地问原因：你的手怎么受伤了？ 叔叔回答：我在马路上看见一个男孩儿拿着刀子刺向了一个女孩的屁股。 婶婶：这跟你的手有什么关系？ 叔叔：这时我的手刚好在那女孩的屁股上。','2013-10-28 20:29:55','2013-10-28 20:29:55'),(131,'吹灯','从前有家非常吝啬的人家。一天老头到城里办事，感到下腹不适，总是憋着、忍着，最后实在不行了，只好到厕所去了。因到家里，他很高兴地把这事和老婆说了，说没想到只是一个屁。他老婆埋怨地说：你也太不会过（日子）了，留着回来吹灯呀！','2013-10-28 20:29:56','2013-10-28 20:29:56'),(132,'女秘书的初夜','女秘书因工作出色，在老板的撮合下，她和一名能干的职员结了婚。初夜......新郎：小声点儿，别人听到了多难为情！新娘：你说话怎么和老板一样呀！','2013-10-28 20:29:56','2013-10-28 20:29:56'),(133,'象家长','妻子：老公，我穿这件衣服就不象孩子妈妈了吧？丈夫：不象，象家长。','2013-10-28 20:29:56','2013-10-28 20:29:56'),(134,'身价百倍','丈夫，在许多女人眼里，是个一无是处的废物。她们甚至不肯为丈夫多花一个子儿。可一旦丈夫被车撞死，便马上会身价百倍，变得至少值５万美元。','2013-10-28 20:29:57','2013-10-28 20:29:57'),(135,'因何而嫁','为什么你会嫁给你丈夫？一个长舌妇邻居问妻子道，你与他并没有多少共同之处。这是个古老的异性相吸的道理。妻子解释道，那时我怀孕了，而他没有。','2013-10-28 20:29:57','2013-10-28 20:29:57'),(136,'在产院','妻子：“虽然是女儿，但你看这鼻子、这嘴多象你呀，漂亮吧！ ”丈夫：“哼，最重要的东西还不是象你！ ”','2013-10-28 20:29:58','2013-10-28 20:29:58'),(137,'胡子','丈夫：早晨刮刮胡子，感觉年轻了10岁！妻子：哼！如果真那样，就睡觉前刮。','2013-10-28 20:29:59','2013-10-28 20:29:59'),(138,'钓鱼','丈夫热衷於钓鱼,他把自己所钓到的大鱼.名贵鱼拍成相片,贴在床头墙壁上, 并且一一注上它们的名称.重量以及垂钓地点,乐此不疲. 妻子见状,便将自己的玉照挂在丈夫床头,并在旁边注明: 美人鱼 49.5 Kg,钓於人民公园.','2013-10-28 20:29:59','2013-10-28 20:29:59'),(139,'帐单','一位债台高筑的男人绝望的看著那堆帐单，发愁忽然叫到：谁要是能解除我的烦恼。我就给他一千元。我可以，妻子回答，一千元在哪里！那是第一个烦脑呀！丈夫说。 ','2013-10-28 20:29:59','2013-10-28 20:29:59'),(140,'任君选择','丈夫下班回家，妻子准备好了晚饭。 “亲爱的，今晚的菜你可以选择。”妻子说。 “都有些什么菜呢？” “芦笋。”妻子答。 “有什么选择呢？” “你吃或是不吃？”','2013-10-28 20:30:00','2013-10-28 20:30:00'),(141,'埋 怨','在车站的月台上，一对夫妻正在互相埋怨。丈夫望着已经开出的次车对妻子说：“都怪你！要不是你一个劲地磨蹭，我们满可以坐上这趟火车。” “都怪你！ ”妻子回敬道，“要不是你一个劲地催命，我们满可以不用花好多时间等下趟火车。”','2013-10-28 20:30:00','2013-10-28 20:30:00'),(142,'糊涂','夫：“你出去时，可别带那只怪模怪样的花狗去。” 妻：“我觉得那条花狗很可爱。” 夫：“你一定要带着它，是想以它作为对比，显示出你的美貌吧？” 妻：“你真糊涂，如果想那样，我还不如带你出去更好！ ”','2013-10-28 20:30:00','2013-10-28 20:30:00'),(143,'夫妻不同','A教授从研究室回到家中，见桌上装饰着很大的一束花，他就问夫人：“今天是什么日子？” “呀？你忘了么？今天是你的结婚纪念日埃” 他听了，微微一笑：“原来如此，谢谢你！到了你的结婚日，我也买一个大花束来祝贺你。”','2013-10-28 20:30:01','2013-10-28 20:30:01'),(144,'新婚夜的忏悔','新婚之夜，不安的新娘告诉新郎，她有事要向他忏悔。新郎说：“亲爱的，没关系，我知道你跳过脱衣舞。”新娘说：“可是，我要忏悔的是在之前的事。”新郎问：“难道你要说你以前放荡不羁，非常不自爱吗？”新娘说：“是的，在我还没经过变性手术之前....”','2013-10-28 20:30:01','2013-10-28 20:30:01'),(145,'准确部位','妻子说：“孩子不听活，是该打，可你不应该老是扭他的耳朵。”“要扭哪儿？”丈夫问。“打屁股，那是块死肉。”“你真糊涂，屁股听得进话吗？”','2013-10-28 20:30:01','2013-10-28 20:30:01'),(146,'男子汉','齐达内：“你猜我领到工资后会怎么办？” 菲戈：“交给老婆？” 齐达内：“不，是存到银行。” 菲戈：“这才是男子汉。” 齐达内：“然后把存折交给老婆。”','2013-10-28 20:30:01','2013-10-28 20:30:01'),(147,'不是我行是他行','一对夫妇久婚不育，他们检查治疗了很久均未凑效。因此他们非常着急。于是女的受一位朋友的推荐，就去看了一个医生。过了不久，女的怀孕了。喜讯传来，他的丈夫高兴得不得了，对老婆说：“我们终于有孩子了，你真行！ ”他的老婆听了回答说：“不是我行，是那个医生行！ ”','2013-10-28 20:30:02','2013-10-28 20:30:02'),(148,'重要的事','一人早上醒来，发现妻子死在床上。他赶紧跳起来，脸色苍白、跌跌撞撞地奔下楼梯大声喊道：“阿梅！阿梅０ 女佣回答：“先生！什么事？“ “早餐的鸡蛋煮一个就够了０','2013-10-28 20:30:02','2013-10-28 20:30:02'),(149,'某君再婚 新婚之夜……','某君再婚，新婚之夜，灯下看新娘，粉迹深处，皱纹如织，不禁怅然问道： “娘子芳龄几何？” “四十少二。” “不止吧？” “你眼力不错，四十有五了。”“你我既然结为夫妻，何必撒谎呢？” “实不相瞒，实足年龄已五十四了。” 上床后，新郎突然想起盐罐没盖，“我得到厨房把盐罐盖上，免得老鼠偷吃。” 新娘不禁笑了起来：“傻瓜，我活了六十八年，还没有听说老鼠偷吃食盐呢！ ”','2013-10-28 20:30:02','2013-10-28 20:30:02'),(150,'银 婚','一对夫妇上照相馆拍摄一张银婚纪念照，摄影时，摄影师对妇人说：“你靠近一点，手搭在你先生的肩上，这样照起来就会自然一些。”先生苦笑着说：“如果想拍一张更写实的照片，应该让她的手插进我的衣袋里。”','2013-10-28 20:30:03','2013-10-28 20:30:03'),(151,'拳 击  ','夫妻俩常常发生争论，而每次争论的结果，总是妻子赢。每当争论到最激烈的时刻，丈夫就会退出争论而走到地下室去。在那里，保留着一个练习拳击用的吊袋。每次走到那里，他总要对准了吊袋猛击它15分钟，把怒气发泄出去，然后就觉得心情舒畅了o 有一天，形势变了，争论的结果，丈夫赢了。这位丈夫感觉到他那位妻子快要大发脾气了，就建议去试一试他的那个吊袋。妻子接受了他的意见，来到地下室，一连十几分钟的猛击猛捶之后，她回到了楼上，乐得嘴都合不拢了。 丈夫问她：“怎么这样高兴?” 她回答说：“我为什么不应该高兴?我在第三轮就把你打','2013-10-28 20:30:03','2013-10-28 20:30:03'),(152,'虚 惊  ','    妻子抱怨晚上太冷，买了一床电热毯，但丈夫伯不安全，经过半天时间解释，他才肯睡这床电热毯。 在睡前，妻子在烤箱里放了一块火腿，用低温烤着，以便早上起来不必赶做早点。 到午夜后，一阵肉香飘人卧室’丈夫从梦中惊醒，跳起来，摇醒妻子说：“亲爱的，快醒来，我们被烤熟了。”  ','2013-10-28 20:30:03','2013-10-28 20:30:03'),(153,'馅的问题 ','早上找衣服穿准备上班，套了一件久未穿的裙子，对着镜子自语：“唉呀！怎么像包粽子一样。” 在一旁洗脸的老公说：“这就是馅儿的问题啦，可不是叶子的问题。”  ','2013-10-28 20:30:04','2013-10-28 20:30:04'),(154,'将计就计','一个女人在饭馆里责骂她的丈夫。最后，她尖声叫道：“在世界上所有可耻的人中，你是最卑鄙的一个!”这时，饭馆里所有的人都吃惊地看着他们。她丈夫察觉后，马上提高声音说：“骂得太好了，亲爱的!你还对他讲了些什么?”  ','2013-10-28 20:30:05','2013-10-28 20:30:05'),(155,'姐夫的眼睛 ','姐夫个性木讷寡言，与内向的姐姐正好是一对。婚前二人同事3年，彼此虽然有意，却没有勇气表白。后来在同事安排下，他们开始约会了。姐姐羞怯怯地问道：“为什么每次我们四目相投的时候，我总觉得你的眼里有很特别的东西？” 姐夫脸红红地答道：“哎呀！你怎知道我有砂眼的？不过请放心，医生说差不多已痊愈了。”  ','2013-10-28 20:30:05','2013-10-28 20:30:05'),(156,'意外的意外','    在外地出差的丈夫回到家后发现妻子和她的情人在聊天。而且妻子的情人表明他很爱她，她也很爱他。丈夫很生气决定和他决斗。两人到了另外一个屋子里，丈夫说：“我们都朝空中开一枪，然后倒在地上。她进屋后先跑向谁谁就拥有她.”两人商量好后向空中开了一枪。 妻子推门进来，看见两人躺在地上，跑向大衣柜说：“亲爱的出来吧，他们俩个都死了。”  ','2013-10-28 20:30:05','2013-10-28 20:30:05'),(157,'使用说明书  ','婚礼上，司仪问新郎：“准备结婚典礼很忙，期间有没有看看书？比如《新婚必读》之类？” 新郎：“没有。” 司仪：“那你们看什么书？” 新郎：“使用说明书。”  ','2013-10-28 20:30:06','2013-10-28 20:30:06'),(158,'怕老婆','A：你拿了工资怎么处置？ B：交给老婆。 A：看来你不如我。 B：你会怎样？ A：我会把它存进银行，然后…… B：然后怎么样？ A：然后把存折交给老婆。  ','2013-10-28 20:30:06','2013-10-28 20:30:06'),(159,'找个借口','门外传来了敲门声，乔对妻子说：“我敢打赌，准是隔壁的布鲁格那家伙借东西来了，我们家一半的东西他都借过。” “我知道，亲爱的。”乔的妻子答：“可你为什么每次都向他让步呢？你不会找个借口吗，这样他就什么都借不走。” “好主意。”乔走到门口，去接待布鲁格。 “早晨好！ ”布鲁格说，“非常抱歉来打搅您。请问您今天下午用修枝剪吗？” “真不巧，”乔答道，“今天整个下午我要和妻子一起修剪果树” “果真不出我之所料。”布鲁格说，“那么您一定没时间打高尔夫球了，把您的高尔夫球杆借给我，您不会介意吧！ ”  ','2013-10-28 20:30:06','2013-10-28 20:30:06'),(160,'结婚晚了','结婚才5个月，妻子就生下了一个白白胖胖的男孩。 丈夫怀疑地问：“这孩子来得是否太早了点？” “不，”妻子回答。“是我们结婚结得晚了点。”  ','2013-10-28 20:30:07','2013-10-28 20:30:07'),(161,'喝咖啡 ','妻子：“刚才在朋友家里你喝了五杯浓咖啡，你不是说一喝咖啡晚上就睡不着觉吗？” 丈夫：“可是，面对着能白喝的咖啡不喝，回家后我就更睡不着了。”  ','2013-10-28 20:30:07','2013-10-28 20:30:07'),(162,'结婚需要','女:男人结婚需要什麽!? 男:勇气 男:女人结婚需要什麽!? 女:运气  ','2013-10-28 20:30:07','2013-10-28 20:30:07'),(163,'越来越短 ','在舞场上，一位姑娘和一位陌生的男子跳舞。 姑娘问：“您真是一个神奇的人物，跟您一起跳舞，我觉得舞曲变得越来越短了。” 那个男子答道：“这有什么可奇怪的，乐队指挥是我的未婚妻。”  ','2013-10-28 20:30:08','2013-10-28 20:30:08'),(164,'自讨苦吃','丈夫同卖菜人讨价还价地买了几斤廉价藕，满以为可对妻子炫耀，不料，却换来了妻子破口大骂：“笨蛋！为何不买别的菜，这藕一斤少说也有半斤窟窿，还说便宜？”  ','2013-10-28 20:30:08','2013-10-28 20:30:08'),(165,'老头进城 ','一大早，乡下的老头到城里去看儿子，在路上把腰扭伤了。在医院里挂号时拿了个“ 1”号，这时候大夫还没有上班，于是老头就在门外等。过了一会，大夫来了在屋里喊“一（yao）号！ ”。老头不知道在喊自己，就没有做声。大夫喊了两声，见没有人答应就往下喊了。老头见比自己后来的都一个个进去了，很生气。 瞅着一个空子就进去问大夫：“我是 1号怎么还排在别人后面？”大夫看了挂号单说：“1就是一(yao)，以后记好了”然后问老头哪里疼。老头开口就说：“1 疼”。大夫还算聪明，楞了一下就明白了，诊断完后就叫老头去打针。  ','2013-10-28 20:30:09','2013-10-28 20:30:09'),(166,'生命在于运动','丈夫叹道：“唉，我的体质越来越差了。” 妻子挖苦他：“野猪能活50年，而家猪只有5年寿命；野狗能活20年，而家犬只有8年寿命，生命在于运动嘛，谁叫你一天到晚像乌龟一样缩着不动！ ” 丈夫听了反问道：“亲爱的，请问乌龟能活多少年？”  ','2013-10-28 20:30:09','2013-10-28 20:30:09'),(167,'吝啬鬼打架 ','丈夫是个吝啬鬼，因夫妻不和，两人经常吵架，一天晚上夫妻又在家里吵闹，越吵越凶，最后厮打起来。正打得难解难分的时候，丈夫的衣服被撕破了，桌上的热水瓶也被妻子撞倒砸碎了，丈夫见状，心痛地叫道：“别打了，要打，咱们脱光衣服到外面去  ','2013-10-28 20:30:09','2013-10-28 20:30:09'),(168,'同床异梦 ','夜深了，夫妇两早已入睡。妻子突然做了个梦，她惊慌地推醒丈夫：“你快走，我丈夫回来了！ ” 丈夫大吃一惊，说道：“真倒霉，我这就走！ ”说完就跳上了窗户……  ','2013-10-28 20:30:10','2013-10-28 20:30:10'),(169,'继续喂金币','男人正在看书，女人大声呼唤男人：“老公，快来，我看见你儿子把一枚硬币放入口中，我倒提着他的腿，结果吐出来两枚硬币，你看是不是要上医院？”男人大怒说：“不，傻瓜，赶快再喂硬币，再倒提双腿。”女人愕然。  ','2013-10-28 20:30:10','2013-10-28 20:30:10'),(170,'老婆与名片','前几天我在此处发表了两篇所谓的“笑话”，一个叫“我是你老婆”，另一个叫“名片的故事”；几天后，我特意留意了一下；您猜怎么了？内容非常好笑的“名片的故事”只有14423个人去看，而内容只有一句话---- 你是我老婆的“我是你老婆”却有近三万人去看之，您说我们的心理是怎么回事？是不是大家都有了些毛病？我想我们中国人的目前状况就是如此吧；多么希望大家能把业余的时间都用在学习上，把自己培养成一位有能力的人，老是追求另样心理和刺激，我们的老大中国迟早会被世界看不起的；你将没有未来。  ','2013-10-28 20:30:11','2013-10-28 20:30:11'),(171,'现实的女人','大愚告诉朋友：“哎，我两次向丽丽求婚她都不答应。后来我就告诉她我叔叔特别有钱，可以给我们买一套大房子。”朋友于是问：“丽丽后来同意了？”大愚伤感的说：“是的，她已经是我的婶婶了。”  ','2013-10-28 20:30:11','2013-10-28 20:30:11'),(172,'便宜的东西','情人节时。 女：亲爱的！我喜欢大大的玩偶！ 七夕时。 女：亲爱的！我喜欢法国香水！ 生日时。 女：亲爱的！钻石代表永！ 圣诞节时。 女：亲爱的！我。。。 男：等一下，宝贝！你有没有喜欢便宜的东西？ 女：有啊！我最喜欢你了！  ','2013-10-28 20:30:11','2013-10-28 20:30:11'),(173,'谁跳的高 ','   记者问跳高冠军“你知道谁跳的最高？”“我老婆”跳高冠军回答 记者又问“什么时候？”答“拿了奖金不给她时 她跳得比我还高”  ','2013-10-28 20:30:12','2013-10-28 20:30:12'),(174,'治疗失眠','有一对夫妇经营着牧常由于过度操劳，丈夫患上了失眠症。常常整夜睡不着觉。于是妻子告诉他，睡不着觉时就躺在床上默默地数羊，便会慢慢地睡着。他依法试了，仍不奏效。 “你准是太心急了，必须专心一意地数，并且数到1万才会有效。今晚你再试试。” 第二天早晨，丈夫恨恨地说：“仍是一夜没睡着！我数完了1万只羊，剪了羊毛，梳刷妥当了，纺织成布，缝制成衣，运往美国，全都卖出去了，整笔买卖赚了321万元！ ”  ','2013-10-28 20:30:12','2013-10-28 20:30:12'),(175,'狗 名','妻子：“我想给小狗起个名字叫‘拜伦’，母亲说这样会侮辱了这位诗人；后来我想把你的名字改给它，母亲又说不好。” 丈夫：“你的母亲真好。” 妻子：“她说这样会侮辱了小狗。”  ','2013-10-28 20:30:13','2013-10-28 20:30:13'),(176,'乱世情缘','一一你刚才是和谁打招呼呀? 一一他是我第二个丈夫的第一个妻子的第三 个丈夫。 一一你竟然记得! 一一因为现在他是我丈夫。  ','2013-10-28 20:30:13','2013-10-28 20:30:13'),(177,'纯洁的新娘','汤姆本是一个花花公子。有一天突发奇想要改邪归正，并找一个天底下最纯洁的少女与其结婚。经过一翻努力终于如愿。婚后第二天，杰克在酒馆见到愁霉苦脸的汤姆，说到：“你刚结婚为什么不在家陪着新娘子？而一个人在这里喝闷酒。”“嗨！你不知道，今天早上一起床，我随手给了她一百圆钱。”“你可以和她好好解释解释，认个错吗。”杰克说。“不是应为这个，而是她紧跟又找了我二十圆钱。”  ','2013-10-28 20:30:13','2013-10-28 20:30:13'),(178,'唱歌的太太','曾太太每天都在唱歌他的老公都躲在阳台上，今天曾太太又在唱歌，他老公又躲在阳台上，曾太太生气的问老公：你难道一点都不欣赏我的歌声吗？他老公说：我只是想让别人知道～我并没有打你  ','2013-10-28 20:30:14','2013-10-28 20:30:14'),(179,'男仆的故事','一个名叫詹母斯的男仆为一对富有的夫妇做事。妻子非常漂亮，比丈夫要年轻许多。一天晚上他们告诉詹姆斯他们要出去很晚，但妻子孤身一人比预订时间早就回家了。 “詹姆斯，”她说，“到我房间来。”他跟着走了进去。她关上房门，说到：“把我的衣服脱下来。”他照做了。“现在，把我的袜子脱下来，”她接着说。他将长袜卷了下来。“脱掉我的内衣。”他将那些也都脱了下来。 “现在，詹姆斯，”她盯着他的眼睛说，“不要让我再逮着你穿我的衣服！ ”  ','2013-10-28 20:30:14','2013-10-28 20:30:14'),(180,'细心的太太 ','某男因公事要很晚回家, 细心的妻子怕丈夫回家后找不到他需要的东西, 就在临睡前写了张字条放在桌上:“ 亲爱的, 啤酒在冰箱里第三层, 烤鸡在微波炉内,我在床上”。  ','2013-10-28 20:30:14','2013-10-28 20:30:14'),(181,'美好人生','丈夫杰克是一个电视迷。一天他问他的妻子今天有什么新的剧情，妻子说：“ 罗娜的丈夫因为抢劫而被捕，露丝堕胎了，杉姆跳楼了，茹如因为吸毒而死，他的妹妹没钱上学，汤姆袭警被抓。” 丈夫叫到：“这部片子叫什么名字？”妻子说：“美好人生。”  ','2013-10-28 20:30:15','2013-10-28 20:30:15'),(182,'窃听器 ','新婚夫妻蜜月旅行,住进一家客店.晚上新郎正要关灯,新娘不安地问新郎:“屋里会不会有窃听器?“ “不会有,亲爱的.“新郎安慰她. “万一有窃听器,那多难堪!“ 新郎四处查看.最后掀开地毯,果然发现一个小巧的玩艺儿.新郎拧开外圈,除去中间的硬块后上床去了. 第二天早上侍者叫醒了这对夫妻,问他们昨晚睡得可好? “很好,谢谢!“新郎不满地问,“干么这么早来打搅我们?“ “非常抱歉!“侍者说,“因为住在你们楼下的夫妻昨晚发觉有只吊灯落在他们身上!“  ','2013-10-28 20:30:15','2013-10-28 20:30:15'),(184,'遗 传','    一老汉见儿媳很漂亮起了歪心，但也没有好办法，整天唉声叹气。老婆问为什么，老汉如实告知，老婆说：你就威胁她说若不怕丢人就声张，就看谁更丢人。词法果然奏效。老汉满意后问老伴怎么想到这个办法的，老伴说：当年你老爸就是用这个办法得到我的。 ','2013-10-28 20:30:16','2013-10-28 20:30:16'),(185,'心在这里 ','有置妾者，与妻行乐，妻曰：“你身在这里，心自在那里。”夫曰：“若然，待我身在那里，心在这里何如？”  ','2013-10-28 20:30:16','2013-10-28 20:30:16'),(186,'黑色幽默','妻（趴在丈夫的病床边）：你一定不能死，汤姆。我偌大一个衣橱里，连一件黑衣服也没有。 夫（对游泳教练）：你可以教我太太淹死吗？  ','2013-10-28 20:30:16','2013-10-28 20:30:16'),(187,'军人的需要 ','一位新婚军人写信给他的太太说： 假如能的话，你下礼拜来看我吧。我生理上感到需要，而且也缺钱用，所以请你带一百块来。 Ps：若不能来就寄两百块给我。  ','2013-10-28 20:30:17','2013-10-28 20:30:17'),(188,'听谁说','恋爱后是他说她听，订婚后是她说他听，结婚后是两人说邻居听。','2013-10-28 20:30:17','2013-10-28 20:30:17'),(189,'和她不熟','布郎森夫妇结婚已有三十年了。布郎森先生每天外出上班，他妻子则在家里操持家务。一天晚上，布郎森太太羡慕地对丈夫说：“对面楼上搬来一对年轻夫妻，我注意他们很久了。那个男的帅小伙儿每天出门都要与妻子吻别，回家时也要亲吻妻子，人家多亲热呀！你为什么就不能这么做呢？”“可是，我和那位女士还不怎么熟埃”丈夫为难地说。','2013-10-28 20:30:17','2013-10-28 20:30:17'),(191,'幸运','两个酒鬼在一起喝酒，其中一个说道:“我真倒霉，我的老婆拿走了我所有的财产跑了。”另一个酒鬼说道:“老兄，你还是挺幸运的，我的老婆拿走了我所有的财产，但是她还不肯走！ ”','2013-10-28 20:30:18','2013-10-28 20:30:18'),(192,'某老公撒谎的最高境界','有一对夫妇，丈夫很喜欢打保龄球但也很怕老婆，老婆很爱抽烟，一天晚上，老婆发现在自己的烟抽完了，便叫丈夫去买，丈夫没有办法只好去买，可是已经很晚了，附近的小卖部都关门了，这可把丈夫急坏了，丈夫突然想到酒吧应该有卖烟的，于是丈夫去了，到了酒吧那个丈夫一眼就看见吧台座着一位漂亮的小姐，于是他走过前去跟那位小姐聊天，然后就一起去开房。到了半夜，丈夫突然想到忘了给自己的太太买烟了，又怕自己的太太知道这件事后会打死他，于是他就问那位小姐有没有滑石粉，小姐很奇怪但还是给他了，丈夫将滑石粉涂到自己的手上就回家了，刚进家门','2013-10-28 20:30:18','2013-10-28 20:30:18'),(193,'狗和丈夫','丈夫抱怨说：“亲爱的，你把我的名字给了咱们的小狗，这样我会经常弄错的。” “不会的，叫狗时我的声音特别和蔼。”','2013-10-28 20:30:19','2013-10-28 20:30:19'),(194,'明天检查妇科','夜晚，一对夫妇躺在床上。丈夫温柔的拍妻子的肩膀并开始摩擦妻子的手臂，妻子转过身说：亲爱的，对不起，我明天要去看妇科医生，我想保持清洁。丈夫遭到拒绝，无奈的转过身去准备睡觉了。可过了几分钟，丈夫又转过来开始温柔的拍妻子的肩膀，这次他凑到妻子耳边轻轻的问：明天你也要去看牙医吗？','2013-10-28 20:30:19','2013-10-28 20:30:19'),(195,'80岁的夫妻','一对80岁的夫妇想要个孩子。他们去医生那里咨询，医生表示是可能的，并给这对夫妇一个瓶子，让他们采集精子和卵子然后医生来给他们人工授精。第二天，夫妇俩把一个空瓶子还给了医生。医生奇怪的问到：怎么了。老人回答：昨天我们一回家就开始了，我先是用自己的手弄，但没效果，然后我夫人用她的手帮我，也没用，于是她又用她的嘴，后来她手口并用，连牙都用上了，可我就是就是……“就是无法勃起是吗？”医生问到。 “不是”老人回答“我就是打不开这个瓶子盖！ ”','2013-10-28 20:30:19','2013-10-28 20:30:19'),(196,'今晚才做的东西','一对新人在教堂举行结婚典礼，到了互换戒指的时候，紧张过度的新郎竟然忘了这件事。 牧师非常焦急的举起手指，做出套戒指的动作，并眨着眼睛暗示新郎。 只见新郎胀红着脸，结巴地说：“牧师，那不是今晚洞房之夜才做的吗？”','2013-10-28 20:30:20','2013-10-28 20:30:20'),(197,'超级老色鬼','李是一位结过婚的老色鬼，有天老李的老婆要求老李带她去牛肉场，但老李不肯可是他老婆硬要老李只好答应了。老李一开始一进场时里面的小弟马上向老李问好:嗨老李!他老婆瞪他一眼老李也不敢说什么。Show开始后广播响起:老李请上贵宾席!老李只好带他老婆一起去坐贵宾席，等Show演到最后时女主角脱掉内裤，台上女主角问:这件内裤要给谁？台下观众不约而同的说:给老李！Show终于结束了老李带老婆去搭出租车一上车老婆非常不高兴的打老李一巴掌出租车司机说:老李呀，你今天带的妞真凶呀。','2013-10-28 20:30:20','2013-10-28 20:30:20'),(198,'快躺到床上去','瓜瓜在捷运高架道路旁买了一栋三楼的房子…… 每回电联车通过时，噪音都很大，瓜瓜的太太还感觉到床铺会震动。某天她实在是忍受不住了，于是打电话给房屋中介公司，向售屋经记人员抱怨…… 那位年轻的经记人赶到了她家，实在不相信床铺会震动…… 瓜瓜的太太生气地说：“不相信的话，你自己躺到床上去就知道了” 年轻的经记人于是脱了外套躺到床上，这时瓜瓜正好回家，看到这样的情景，大声质问说：“你在干什么？” 年轻的经记人一脸无辜地说：“我如果告诉你，我在等捷运经过，你会相信吗？？？”','2013-10-28 20:30:20','2013-10-28 20:30:20'),(199,'是谁干你的','出海两年多的的船员阿福终于回到家乡。但，一回到家的他却发现多一个婴儿！阿福激动的问着妻子：“是谁干的好事？是不是隔壁的阿呆？”“不是。”妻子回答“是不是我的朋友阿瓜？”“不是。”“一定是小王，我那该死的酒肉兄弟！ ”“烦死人了！ ”妻子叫道：“难道我就没有自己的朋友吗？”','2013-10-28 20:30:21','2013-10-28 20:30:21'),(200,'妻脱光倒立镜前','某男久不行房,妻很难受。一日他要妻脱光倒立镜前,妻大喜照办。他将妻双腿分开，将自己下巴放于妻阴部后问妻：我留胡子好看吗？','2013-10-28 20:30:21','2013-10-28 20:30:21'),(201,'那天我偷看了老婆的日记','不经意发现老婆还有个小本本，仔细一看，原来是日记： 1.今天买菜多向老公报了10元钱，自己也应该一点一点地攒私房钱了。2.对老公撒谎说丢了100元钱，装作很懊悔的样子。我要用这钱护理护理头发，省得他埋怨我每次做头都在浪费钱。 3.给老公买了一件T恤，明明是80元，我告诉他花了150元。既让他觉得穿着体面，我又得了实惠，真是一举两得。 4.在老公面前表现得百依百顺，温柔体贴，抢着干家务，在他飘飘然的时候，向他提出购买我心仪已久的裙子，虽然贵了点，他居然同意了，原来美人计是如此好用！ 5.结婚纪念日前一天，准','2013-10-28 20:30:21','2013-10-28 20:30:21'),(202,'南非的女人做事后','有一位丈夫放下杂志看看太太说：我刚晓得。 \n南非的女人在每次的房事完毕之后都会给先生八块钱。 \n这么好的机会我怎么能错过明天我就去南非。 \n太太叫道：我也要去。 \n先生：你去干什么。 \n太太：我去看看你一个月只赚十六块怎么活下去。','2013-10-28 20:30:22','2013-10-28 20:30:22');
