INSERT INTO `notes` VALUES (1,'redis 安装','<div style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; line-height: normal; orphans: 2; text-align: -webkit-auto; widows: 2;\">\r\n<div>\r\n<p>下载安装<br />\r\nwget http://download.redis.io/releases/redis-2.6.16.tar.gz<br />\r\ntar xzf redis-2.6.16.tar.gz<br />\r\ncd redis-2.6.16<br />\r\nmake<br />\r\nsudo make install</p>\r\n\r\n<p>下载启动文件<br />\r\nwget https://github.com/ijonas/dotfiles/raw/master/etc/init.d/redis-server<br />\r\nwget https://github.com/ijonas/dotfiles/raw/master/etc/redis.conf<br />\r\nsudo mv redis-server /etc/init.d/redis-server<br />\r\nsudo chmod +x /etc/init.d/redis-server<br />\r\nsudo mv redis.conf /etc/redis.conf</p>\r\n\r\n<p>创建redis用户<br />\r\nsudo useradd redis<br />\r\nsudo mkdir -p /var/lib/redis<br />\r\nsudo mkdir -p /var/log/redis<br />\r\nsudo chown redis.redis /var/lib/redis<br />\r\nsudo chown redis.redis /var/log/redis</p>\r\n\r\n<p>设置开机启动项<br />\r\nsudo update-rc.d redis-server defaults</p>\r\n\r\n<p>启动<br />\r\nsudo /etc/init.d/redis-server start</p>\r\n\r\n<p>设置密码<br />\r\nCONFIG SET requirepass secret_password&nbsp;</p>\r\n\r\n<p>出错处理：<br />\r\nconfig set stop-writes-on-bgsave-error no</p>\r\n</div>\r\n</div>\r\n',1,'2013-10-20 19:15:19','2013-10-20 19:15:48'),(2,'nokogiri','<p>#encoding: utf-8<br />\r\nrequire &#39;nokogiri&#39;<br />\r\nrequire &#39;open-uri&#39;<br />\r\n#申明两个数组变量<br />\r\narr = []<br />\r\nsong_name = []<br />\r\npage=[]<br />\r\n#分页循环<br />\r\n(1..17).each do |x|<br />\r\n&nbsp;doc = Nokogiri::HTML(open(&#39;http://www.ximalaya.com/1372452/?page=&#39;+x.to_s))<br />\r\n&nbsp;#取得每页中的歌曲和点击数<br />\r\n&nbsp;doc.css(&#39;.play-count&#39;).each do |link|<br />\r\n&nbsp; &nbsp;arr &lt;&lt; link.content.to_i<br />\r\n&nbsp; &nbsp;song_name &lt;&lt; link.parent.parent.parent.css(&#39;a&#39;)[0].text<br />\r\n&nbsp;end<br />\r\n&nbsp;page &lt;&lt; arr.size<br />\r\nend<br />\r\n# puts &quot;每页&quot;+page[0].to_s+&quot;首歌&quot;</p>\r\n\r\n<p>#取得最大点击歌曲的数组的下标<br />\r\nindex = arr.index(arr.sort.last)<br />\r\nputs song_name[index].strip+&quot; &quot;+arr.sort.last.to_s+&quot;次点击&quot;</p>\r\n',2,'2013-10-21 19:49:34','2013-10-21 19:49:34'),(3,'devise','<p>http://blog.csdn.net/aabbcc456aa/article/details/7419493</p>\r\n\r\n<p>gem &#39;devise&#39;<br />\r\nrails g devise:install<br />\r\nrails g devise User<br />\r\nrake db:migrate<br />\r\nrails generate devise:views</p>\r\n',2,'2013-10-21 19:50:53','2013-10-21 19:50:53'),(4,'ckeditor','<p>gem &#39;ckeditor&#39;<br />\r\nrails g ckeditor:install</p>\r\n\r\n<p>&lt;%= javascript_include_tag &quot;ckeditor/ckeditor.js&quot; %&gt; &nbsp;<br />\r\n&lt;%= f.cktext_area(&quot;intro&quot;,:width =&gt; &#39;100%&#39;) %&gt;</p>\r\n',2,'2013-10-21 19:52:17','2013-10-21 19:52:17'),(5,'mini_magick','<p>sudo apt-get install imagemagick</p>\r\n\r\n<p>require &#39;mini_magick&#39;<br />\r\ninclude MiniMagick</p>\r\n\r\n<p># 微信图片<br />\r\npath = &quot;1.jpg&quot;<br />\r\nimage = MiniMagick::Image.open(path)<br />\r\nsize = &quot;640&quot;<br />\r\nimage.resize size<br />\r\nimage.format image[:format] &nbsp;<br />\r\nloc = path.rindex(&quot;.&quot;)<br />\r\nname = path.insert(loc,&quot;_weixin&quot;)<br />\r\nimage.write name</p>\r\n\r\n<p><br />\r\n# 头像<br />\r\npath = &quot;1.jpg&quot;<br />\r\nimage = MiniMagick::Image.open(path)<br />\r\nwidth,height = image[:width],image[:height]<br />\r\nif width&gt;height<br />\r\n&nbsp; shaved_off = ((width-height)/2).round<br />\r\n&nbsp; image.shave &quot;#{shaved_off}x0&quot;<br />\r\nelse<br />\r\n&nbsp; shaved_off = ((height-width)/2).round<br />\r\n&nbsp; image.shave &quot;0x#{shaved_off}&quot;<br />\r\nend<br />\r\nsize = &quot;80&quot;<br />\r\nimage.resize size<br />\r\nimage.format image[:format] &nbsp;<br />\r\nloc = path.rindex(&quot;.&quot;)<br />\r\nname = path.insert(loc,&quot;_avatar&quot;)<br />\r\nimage.write name</p>\r\n\r\n<p># wap and 网页缩略图<br />\r\npath = &quot;1.jpg&quot;<br />\r\nimage = MiniMagick::Image.open(path)<br />\r\nsize = &quot;230&quot;<br />\r\nimage.resize size<br />\r\nimage.format image[:format] &nbsp;<br />\r\nloc = path.rindex(&quot;.&quot;)<br />\r\nname = path.insert(loc,&quot;_wap&quot;)<br />\r\nimage.write name</p>\r\n\r\n<p># 缩小 放大 原图的百分之<br />\r\nimage = MiniMagick::Image.open(path)<br />\r\nimage.combine_options do |c|<br />\r\n&nbsp; c.sample &quot;50%&quot;<br />\r\nend<br />\r\nimage.write &quot;big_small.jpg&quot;</p>\r\n\r\n<p># 进入文件夹 avatar_80_80<br />\r\navatar_80_80 = &quot;/opt/menghuanwd/static/uploaders/&quot;<br />\r\nDir.chdir avatar_80_80</p>\r\n',2,'2013-10-21 19:53:02','2013-10-21 19:53:02'),(6,'daemons+scheduler','<p>*.rb :<br />\r\nrequire &#39;rubygems&#39;<br />\r\nrequire &#39;daemons&#39;<br />\r\nDaemons.run(File.expand_path(&#39;../../lib/baidu_count.subscribe.rb&#39;, __FILE__))</p>\r\n\r\n<p>baidu_count.subscribe.rb :<br />\r\nrequire File.expand_path(&#39;../../config/environment&#39;, __FILE__)<br />\r\nscheduler = Rufus::Scheduler.start_new<br />\r\nscheduler.every &#39;86400s&#39; do<br />\r\n&nbsp; key = Settings.baiduyuyincount<br />\r\n&nbsp; cache = CREDIS.with{|c| c.get(key)}<br />\r\n&nbsp; baidu_count = BaiduCount.new<br />\r\n&nbsp; baidu_count.count = cache<br />\r\n&nbsp; baidu_count.up_date = Time.now<br />\r\n&nbsp; baidu_count.save<br />\r\nend<br />\r\nscheduler.join</p>\r\n\r\n<p>ruby *.rb start</p>\r\n',2,'2013-10-21 19:53:21','2013-10-21 19:55:21'),(7,'delayed_job','<p>gem &#39;delayed_job_active_record&#39;<br />\r\ngem &#39;delayed_job&#39;<br />\r\nrails generate delayed_job:active_record<br />\r\nrake db:migrate<br />\r\nDelayed::Worker.new.start &nbsp;<br />\r\n./delayed_job start restart stop status</p>\r\n',2,'2013-10-21 19:54:04','2013-10-21 19:54:04'),(8,'mailer','<p><span style=\"color:rgb(0, 0, 0); font-family:微软雅黑; font-size:14px\">rails g mailer userMailer</span></p>\r\n',2,'2013-10-21 19:54:23','2013-10-21 19:54:23'),(9,'mongoid','<p>rails new mongo_project --skip-active-record<br />\r\ngem &#39;mongoid&#39;<br />\r\nrails g mongoid:config</p>\r\n',2,'2013-10-21 19:54:38','2013-10-21 19:54:38'),(10,'tesseract-ocr','<p><a href=\"http://www.iteye.com/topic/993538\">http://www.iteye.com/topic/993538</a></p>\r\n',2,'2013-10-21 19:55:51','2013-10-21 19:55:51'),(11,'queue','<div style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; line-height: normal; orphans: 2; text-align: -webkit-auto; widows: 2;\">gem &#39;bunny&#39; 发q<br />\r\ngem &#39;amqp&#39; 收q</div>\r\n',2,'2013-10-21 20:05:29','2013-10-21 20:05:29'),(12,'安装nginx','<p>sudo apt-get install libpcre3-dev build-essential libssl-dev<br />\r\ncd /opt/<br />\r\nsudo wget http://nginx.org/download/nginx-1.3.7.tar.gz<br />\r\nsudo tar -zxvf nginx-1.3.7<br />\r\ncd /opt/nginx-1.3.7/<br />\r\nsudo ./configure --prefix=/opt/nginx --user=nginx --group=nginx --with-http_ssl_module<br />\r\nsudo make<br />\r\nsudo make install<br />\r\nsudo adduser --system --no-create-home --disabled-login --disabled-password --group nginx<br />\r\nsudo wget -O init-deb.sh http://library.linode.com/assets/1139-init-deb.sh<br />\r\nsudo mv init-deb.sh /etc/init.d/nginx<br />\r\nsudo chmod +x /etc/init.d/nginx<br />\r\nsudo /usr/sbin/update-rc.d -f nginx defaults<br />\r\nsudo /etc/init.d/nginx start &nbsp;</p>\r\n',1,'2013-10-21 20:07:07','2013-10-21 20:07:07'),(13,'安装rabbitmq','<p>进入 /etc/apt/sources.list 添加：<br />\r\ndeb http://www.rabbitmq.com/debian/ testing main</p>\r\n\r\n<p>sudo apt-get install rabbitmq-server<br />\r\nrabbitmq-plugins enable rabbitmq_management</p>\r\n',1,'2013-10-21 20:08:23','2013-10-21 20:08:44'),(14,'安装mysql','<p>sudo apt-get install libmysqlclient-dev<br />\r\nsudo apt-get install mysql-server<br />\r\nsudo mysql_secure_installation<br />\r\nsudo mysql -u root -p</p>\r\n',1,'2013-10-21 20:09:21','2013-10-21 20:09:21'),(15,'安装rvm ruby','<div style=\"color: rgb(0, 0, 0); font-family: 微软雅黑; font-size: 14px; line-height: normal; orphans: 2; text-align: -webkit-auto; widows: 2;\">curl -L https://get.rvm.io | bash -s -- --version latest<br />\r\nrvm install ruby<br />\r\n/bin/bash --login<br />\r\nrvm --default use 2.0.0</div>\r\n',1,'2013-10-21 20:10:11','2013-10-21 20:10:11'),(16,'安装git','<p>sudo apt-get install git git-core</p>\r\n',1,'2013-10-21 20:10:41','2013-10-21 20:10:41'),(17,'安装openssh','<p>sudo apt-get install openssh-server</p>\r\n',1,'2013-10-21 20:11:02','2013-10-21 20:11:02'),(18,'新装电脑不能联网','<p><span style=\"line-height:1.6em\">/etc/resolv.conf:</span><br />\r\nnameserver 8.8.8.8<br />\r\nnameserver 8.8.4.4</p>\r\n',3,'2013-10-21 20:13:10','2013-10-21 20:13:10'),(19,'apt-get 安装 卸载','<p>安装软件 apt-get install softname1 softname2 softname3&hellip;&hellip;<br />\r\n卸载软件 apt-get remove softname1 softname2 softname3&hellip;&hellip;<br />\r\n卸载并清除配置 apt-get remove --purge softname1<br />\r\n更新软件信息数据库 apt-get update<br />\r\n进行系统升级 apt-get upgrade</p>\r\n',3,'2013-10-21 20:14:09','2013-10-21 20:14:09'),(20,'linux常用命令','<p>重启<br />\r\nshutdown -r now<br />\r\n查看<br />\r\nps -ef|grep thin<br />\r\nps -aux|grep feedback<br />\r\n请求<br />\r\ncurl -i -A &ldquo;other_unitcon&rdquo; -d &quot;device=other_android&amp;id=1074773&quot; &nbsp;http://3rd.ximalaya.com/chezai/played&nbsp;</p>\r\n',3,'2013-10-21 20:16:26','2013-10-28 03:37:54'),(21,'mysql常用命令','<p>备份<br />\r\nmysqldump -h127.0.0.1 -uroot -p1234 menghuanwd_development &gt;menghuanwd.sql<br />\r\nmysqldump -h127.0.0.1 -uroot -p menghuanwd_development &gt;menghuanwd.sql<br />\r\nmysqldump -h127.0.0.1 -uroot -pcaishuying menghuanwd_development &gt; /home/server/sqlbak/menghuanwd.sql</p>\r\n\r\n<p>还原<br />\r\nmysql -uroot -pcaishuying menghuanwd_development &lt; menghuanwd.sql</p>\r\n\r\n<p>修改root密码<br />\r\nmysqladmin -u root -p[oldpass] password newpass<br />\r\nmysqladmin -u root -p password 123 caishuying</p>\r\n',4,'2013-10-21 20:18:05','2013-10-28 03:38:03');
